generated.css:
.btns-wrap,
body {
  font-family: Roboto, sans-serif;
}

body {
  margin: 0;
  overflow: hidden;
  background: #000;
}

.main {
  position: relative;
}

.a-enter-vr-button {
  display: none !important;
}

.btn {
  float: right;
  user-select: none;
  cursor: pointer;
  box-sizing: border-box;
  width: 50px;
  height: 30px;
  background: #f45;
  text-align: center;
  padding: 8px 10px;
  transition: all 0.2s;
}

.custom-button {
  right: 1rem;
  width: 70px;
}

#content {
  z-index: 9999;
  padding: 10px 50px 10px 10px;
  min-width: 300px;
  max-width: 400px;
  display: block;
  background: #fff;
  position: fixed;
  transform: translate(-50%, -50%);
  top: 40%;
  left: 50%;
  filter: alpha(opacity=80);
  -moz-opacity: 0.8;
  -khtml-opacity: 0.8;
  opacity: 0.8;
}

#content #content-wrap p {
  margin-left: 20px;
  font-weight: 500;
  color: #000;
  font-size: 1.5em;
  line-height: 1em;
}

#content #content-wrap ol li {
  margin-bottom: 5px;
}

.gotit {
  text-align: center;
  width: 80px;
  font-size: 1em;
  color: #ffffff;
}

.links {
  color: #0078ff;
}

#header {
  z-index: 9999;
  background-color: #ffff;
  filter: alpha(opacity=80);
  -moz-opacity: 0.8;
  -khtml-opacity: 0.8;
  opacity: 0.8;
  color: #000;
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 50px;
  padding: 0;
  margin: 0;
}

#header #header-content {
  margin: 15px;
  font-size: 1.2em;
}

#footer {
  z-index: 9999;
  background-color: #ffff;
  filter: alpha(opacity=80);
  -moz-opacity: 0.8;
  -khtml-opacity: 0.8;
  opacity: 0.8;
  color: #000;
  position: fixed;
  bottom: 0;
  right: 0;
  width: 100%;
  height: 50px;
  padding: 0;
  margin: 0;
}

#footer #footer-content {
  margin: 10px;
  font-size: 1em;
  left: 50%;
}

#loader {
  position: fixed;
  top: 45%;
  left: 45%;
  border: 8px solid #f3f3f3; 
  border-top: 8px solid #3498db;
  border-radius: 50%;
  width: 50px;
  height: 50px;
  animation: spin 0.5s linear infinite;
}

@keyframes spin {
  0% { transform: rotate(0deg); }
  100% { transform: rotate(360deg); }
}
